import React from 'react';
import Booking from './Booking';

const BookingsList = ({allGuests}) => {
    const guestToDisplay = allGuests.map((guest, index) => {
        <Booking key={index} guest = {guest}/>
    })
    return (
        <ul>
            <Booking />
            <Booking />
            <Booking />
        </ul>
    );
};

export default BookingsList;
